"title": "Coloured -  Magic: The Gathering themed Shot glass. Bespoke engraving.",
"description": "One day, after playing a couple of rounds of MTG with my mates, we got chatting about how having some &#39;Magic-Themed&#39; Glassware would be cool to have, and so here we are!\n\nThere are 5 shot glasses in this set, one representing each type of mana used in the game. The shot glasses are roughly 88mm x 50mm at their highest and widest points respectively.\n\nYou can get these glasses in either the clear or coloured varieties. \nThe coloured glasses are NOT dishwasher safe, only clean in warm soapy water\n\nIf you like my store and are interested in getting free discount-coupons and offers, then please contact me to sign up to my free news letter!!\n\n\n\nNote: All of my engravings are done by hand and therefore will be completely unique. I use some of these glasses at home in the dishwasher and so far they appear dishwasher proof… however, I cannot guarantee that they will stay this way. The coloured glasses are NOT dishwasher safe, only clean in warm soapy water and take particular care not to scrub at the base. \n\nI strive to do my best for all customers, but in the event of breakage in transit, I will not always be able to afford the cost of postage to replace the item, I’m afraid that replacements will have to be at my discretion on a case by case basis. \nYou can also find me on facebook, twitter, instagram, pintrest, tumblr, and in the general blogsphere.  I love crafting projects,  especially if someone is able to give it as a gift to make a friend or loved one happy ^_^\n\nI try to appeal to the major fandoms of the internet, with this in mind it is important to note that I am not trying to claim the rights to any of them, my works are merely works of appreciation from a fan.  I am not and official distributor in any way!",
