"policy_welcome": "Welcome and thank you for stopping by Smiling Cat Vintage!  If these policies do not answer all of your questions, please convo.  \r\n\r\nAll items live in a smoke free environment.\r\n",
"policy_payment": "I accept payments through PayPal or by credit card through Etsy.  Payment must be paid in full and have cleared before item is shipped.\r\n\r\nVirginia residents will be charged 5.3% sales tax to keep it legal!\r\n",
"policy_shipping": "I pack all items to minimize the chance of damage during shipment.  All items are shipped first class via USPS within 3 business days of payment domestically and internationally.  Within the US, items over 1lb will be shipped priority mail, parcel select, or media mail (if appropriate) depending on price. I will always send heavier packages priority mail if the postage received will cover it so that you will get your package as quickly as possible. Shipping within the US always includes delivery confirmation. Customs forms track delivery for international shipping.\r\n\r\nNote that some of the shipping costs may seem high. That is because I am estimating based on the highest cost for that weight. If you live closer, the cost may be substantially lower.  If I have overestimated shipping costs by $2.00 or more, I will refund the overage to you.\r\n\r\nPlease contact me at the time of purchase if you would like to upgrade your shipping for an additional cost.  Any duties or customs are the buyer&#39;s responsibility.\r\n\r\nShipping times vary by location, but items should arrive in 7-14 days. If an item has been delayed longer than that, please let me know. No refunds will be made for 6 weeks from mailing date on international orders to be sure that the package hasn&#39;t gotten stuck in customs.\r\n",
"policy_refunds": "All sales are final.  However, if something arrives in less than perfect condition or gets lost, convo me!\r\n\r\nThe buyer is responsible for all shipping if an item is returned. Requests for returns must be made within 4 days of receipt.\r\n\r\nThe item returned must be received and in the same condition it was when sent before a refund is issued. Refunds will not include shipping, Etsy or PayPal fees. A $2 restocking fee will be charged.",
