"title": "Dragonball Power Pouch. Four Star Dragon Ball Inspired Game Bag. Magic MTG Card Bag. Gamer Makeup Bag. Nintendo DS Case. Dice Bag. DBZ.",
"description": "Ever wished that you could join Goku and the gang on one of their Dragon Ball searches? Well wish no longer, you could have your very own Four Star Dragon Ball... Power Pouch! An irresistible must-have for Dragon Ball lovers! When tied closed this Dragon Ball Power Pouch takes on a round shape because of its circular base (see photo 2) and lack of corners. Get one step closer to releasing a wish granting Dragon like Shenron once you have this Power Pouch in your possession. It features four red stars on the front of the bag and a drawstring to match. The stars were crocheted separately and sewn on by hand. A fun, memorable and unique accessory that is sure to draw attention when seen in public :) What secret wishes will you contain in your Dragon Ball Power Pouch?\r\n- Holds 3 Magic the Gathering card decks (see photo 5) \r\n- Large enough for your Nintendo DS, accessories, and games\r\n- Great for holding dice games\r\n- Fun way to contain your makeup! \r\n- Have a large purse? Use this to keep small belongings from getting lost in there :)\r\n\r\nThis Dragon Ball Power Pouch is hand crocheted with a circular base so there are no corners. The back of the bag has a barely visible seam. This bag is entirely handmade, right down to the drawstrings.\r\n\r\n[ G I F T . I T ! ]\r\nBuy this as a gift for a Dragon Ball fan! Whether a gamer, nerd, or lover of the Dragonball manga or shows, the recipient of this Power Pouch is sure to have a long list of fun ways to put this little bag to use, first of which will be to show it off to all their friends.\r\n\r\nMore Dragon Ball inspired items: http://www.etsy.com/shop/Nerdifacts/search?search_query=dragonball&order=date_desc&view_type=gallery&ref=shop_search\r\n\r\n[ O T H E R . P O W E R . P O U C H E S ]\r\nClick here to see other available Power Pouches: http://www.etsy.com/shop/Nerdifacts/search?search_query=game+bag&order=date_desc&view_type=gallery&ref=shop_search\r\n\r\n** If you&#39;d like to order a custom Power Pouch please contact me so that I can provide a listing for you **\r\n\r\nThis listing is for one [1] Dragon Ball Power Pouch, as featured in the photos.\r\n\r\n[ C R E A T I O N . D E T A I L S ]\r\nEach Power Pouch has been intensely crocheted here in the Nerdifacts studio, and is made from easy to care for 100% acrylic yarn. The Dragon Ball bag features a red star applique that was crocheted separately and sewn on by hand. It was created from an original pattern designed by Maria Walcott.\r\n\r\n[ D I M E N S I O N S . E T C]\r\nJust under 4&quot; in diameter\r\n12&quot; around.\r\n4.5&quot; from bottom to drawstring, sitting on a flat surface\r\n6&quot; from center bottom to drawstring\r\n\r\n[ C A R E ]\r\nGently hand wash in cool water with a mild detergent. Press with hands to remove water, then gently press between two towels to remove as much excess water as possible. Lay flat to fully dry. *If this sounds like too much work for you, you can machine wash in a small garment mesh bag, but be forewarned, it might get fluffy :)\r\n\r\n[ C O M M I S S I O N S ]\r\nI love doing custom work! If you have an idea you&#39;d like me to bring into reality, just contact me with some details and we can discuss options and pricing.\r\n\r\n[ H E L P ]\r\nYou&#39;ll find more information in my shop profile and policies- I encourage you to read the shop policies to ensure a smooth transaction. Contact me with any further questions.\r\np r o f i l e: http://www.etsy.com/people/Nerdifacts\r\np o l i c i e s: http://www.etsy.com/shop/Nerdifacts/policy\r\n\r\n[ K E E P . S H O P P I N G ]\r\nwww.etsy.com/shop/nerdifacts\r\n\r\n[ S H I P P I N G . I N F O ]\r\nAll orders are shipped standard light packet air which takes 14 days or less to reach most destinations in Canada or the US. Might be a little longer for International locations.\r\n* 2 - 3 d a y . e x p e d i t i o n is an additional $30 fee. Unfortunately this is a flat rate with Canada Post (Xpresspost) and I have no control over it. Your order will arrive in 2 OR 3 days. If you want this option, please state: &quot;2-3 day expedition required&quot; in your Notes to Seller. I will send you a paypal invoice for the shipping upgrade, which must be paid before your order will be shipped.\r\n* o v e r n i g h t . e x p e d i t i o n must be quoted first, preferably in advance of purchase as these shipping fees can vary widely and can be quite high.\r\n\r\n[ T H A N K S . F O R . V I S I T I N G ]",
