"policy_payment": "I accept Paypal, Etsy gift cards and direct checkout only.\r\nMust receive payment within 3 days of sale.\r\n\r\nReserving an item:\r\nItems may be reserved for a 20% deposit. This deposit will be taken off the total amount at time of purchase. Items may be reserved up to 14 days.\r\nDeposit is non refundable after 24 hours of reserving an item.\r\nFor multiple item reserves, please contact me.",
