"policy_refunds": "I want my customers to be 100% satisfied with their purchase from BlackPrismz.\r\n\r\nThough I try to ensure that all items will remain intact, all sales are final. No refunds.\r\nHowever, I will gladly exchange an item for you within 10 days of the purchase for another equal value item as long as the item is still in the same condition as you received it. If another item is of higher value, you may add the difference. Buyer pays all shipping costs. \r\nPLEASE READ ALL OF THE DETAILS IN EACH LISTING AS EACH PIECE IS DIFFERENT.\r\n\r\nRepairs:\r\nAll items are sold as is with the exception of a chain link, jump ring or clasp that may need repair. Buyer is required to send a photo of the item to confirm the missing part. Buyer must pay all shipping costs for the purchased item to receive free repair.\r\nOr, if upon request, I will gladly send repair parts.\r\nBuyer pays shipping for any repair options.\r\n\r\nBuyer may contact me via etsy convo and I will try to respond within 48 hrs.\r\n",
