"policy_refunds": "I want my customers to be 100% satisfied with their purchase from BlackPrismz.\r\n\r\nThough I try to ensure that all items will remain intact, all sales are final. No refunds.\r\nHowever, I will gladly exchange an item for you within 10 days of the purchase for another equal value item as long as the item is still in the same condition as you received it. If another item is of higher value, you may add the difference. Buyer pays all shipping costs. \r\nPLEASE READ ALL OF THE DETAILS IN EACH LISTING AS EACH PIECE IS DIFFERENT.\r\n\r\nRepairs:\r\nAll items are sold as is with the exception of a chain link, jump ring or clasp that may need repair. Buyer is required to send a photo of the item to confirm the missing part. Buyer must pay all shipping costs for the purchased item to receive free repair.\r\nOr, if upon request, I will gladly send repair parts.\r\nBuyer pays shipping for any repair options.\r\n\r\nBuyer may contact me via etsy convo and I will try to respond within 48 hrs.\r\n",
"policy_additional": "Multiple item discount:\r\nI will be happy to give a 10% discount on purchases of 5 items or more that are made on the same day.\r\n\r\nCustom ordering:\r\nIf you see something you like in the shop and would like me to make you something similar, please send a request with details of how you would like your item to look. I will do my best to create something close to your needs.\r\nIf there is something you are interested in that has already been sold, I will be willing to make something similar to that item as well.\r\n(to see items sold, go to BlackPrismz front page, select &quot;sales&quot; under shop info)\r\n&gt;Buyer is to pay for all supplies in advance and cost of item(s) before it is made.\r\n&gt;Alterations will be made upon buyers request but not to exceed more than 3 alterations.\r\n&gt;A picture of completed item will be sent before shipping it to the buyer.\r\n&gt;If the item does not come out the way you want it, I will issue a refund for the amount you paid minus the cost of supplies that were specific to your item(s) design.\r\n&gt;Discounts may be applicable to custom ordering for purchases of 5 or more of the SAME item. Please contact me via etsy convo.\r\n\r\n\r\nThanks for your interest and be sure to check out www.facebook.com/BlackPrismz for updates, giveaways, and sales.",
