"description": "We think we make really awesome tee shirts and customized products, but you be the judge of that.  \r\n\r\nThis shirt is inspired by Magic: The Gathering strategic trading card game.   Each of the mana symbols are represented on the front of the ash colored tee.\r\n\r\nEach shirt is professionally printed and prepared for you.  \r\n\r\nThis superior print comes to you on a Gildan Adult (Unisex) Ultra Cotton 100% preshrunk cotton tee.  We use the latest Direct to Garment Printing (DTG) technology to create stunning prints using water based Eco-friendly inks.  We do not use iron on transfers or screen printing with chemical based inks.  Which means no cracking or peeling of the design.  \r\n\r\n\r\n==============\r\nT-SHIRT Size Chart\r\n==============\r\nS – Chest 36”, Length 28”, Sleeve Length 16 ¾”\r\nM – Chest 40”, Length 28”, Sleeve Length 18 ¼”\r\nL – Chest 44”, Length 30”, Sleeve Length 19 ¾”\r\nXL – Chest 48”, Length 31”, Sleeve Length 21 ¼”\r\n2XL – Chest 52”, Length 32”, Sleeve Length 22 ¾”\r\n3XL – Chest 56”, Length 33”, Sleeve Length 24 ¼”\r\n\r\nSleeve length is measured full from the center of the back.\r\n\r\n\r\nDTG Printing produces amazingly detailed prints including photos and illustrations.\r\n\r\n✔ High Quality Digital Printing (No Vinyl or Screen Printing Here)\r\n✔ Eco Friendly Ink\r\n✔ Made to Order (We Do Custom Prints)\r\n✔ High Quality Gildan Pre-shrunk 100% Cotton T-Shirt\r\n\r\n\r\nCool Stuff\r\n\r\nWe are a small boutique shop and manufacturing space in Western New York.  Our customers and their satisfaction is what we put first every single day.  \r\n\r\n\r\nBe sure to check out the other awesome items in our store.",
