"login_name": "Artjig",
"accepts_custom_requests": true,
"policy_welcome": "Hi welcome to Artjig my store for vinyl decals and other goodies. If you would like to learn more about me please visit my about page: https://www.etsy.com/uk/people/Artjig",
"policy_payment": "I accept paypal, credit cards and Etsy gift cards. Payment must be made in full and have cleared before the item is shipped. If you have any issues with Payment please do not hesitate to contact me and I will assist you in anyway that I can.",
"policy_shipping": "All decals are sent via Royal Mail delivery service encased in card. Cushion covers and such are wrapped and placed in durable protective bags. UK shipping usually takes 1-3 days. International shipping is sent via &#39;International standard&#39; shipping and can take between 5-10 days but can sometimes take up to 2 weeks. To try and keep costs down shipping is not &#39;tracked&#39; but I will happily upgrade shipping to &#39;tracked&#39; or &#39;signed&#39; for anyone wanting this service. Cost will be met by buyer. Please message me to arrange &#39;tracked&#39; shipping.",
"policy_refunds": "If you are unhappy with your product for any reason please contact me within 48 hours. I aim to have happy customers so will do my best to resolve any issues. In the unlikely event you receive defective decal you can email me a picture rather than returning it, I’ll get a new one sent out right away or issue you a refund for the product. Please be aware unfortunately I can not refund decals that have been applied incorrectly and damaged in the process. Please read the how to apply guide enclosed with your purchase to avoid any such problems. \r\n\r\nDefected or damaged cushion covers/printed items are eligible for a refund provided they are returned in original packaging and un-used. Refunds may be refused if I deem the cushion to have been used.\r\n\r\nIf you decide you want to return the product please note I cannot be held responsible for missing return items and recommend &#39;tracked&#39; return shipping to avoid any such issues. Unfortunately return shipping cost must be paid by you.\r\n\r\nI reserve the right to refuse a refund if not contacted within 48 hours. \r\nDue to the nature of custom orders No refund or returns will be accepted under any circumstance.\r\n\r\nBest regards.",
"policy_additional": "Images used are to be used as reference. Please note that actual decal size may vary from photo, size shown in images may have been enlarged for visual purposes please use dimensions stated on the individual listings.\r\n\r\nCushion covers: Due to the way in which cotton yarn is produced occasional flecks of coloured thread may be seen in the finished cloth following the weaving process. These may appear on the finished cushion cover but this unavoidable.\r\n\r\nCustom art work:\r\n\r\nA minimal charge is applied to small alterations to existing designs/decals.\r\n\r\nIf you are interested in a custom design please message me, I will be happy to discuss. I charge a £25 non-refundable art work/design fee if art work is required payable upfront, once we have discussed your requirements and are both happy to proceed. \r\n\r\nFor this fee you’ll receive 3 designs with up to 3 simple alterations. This can be processed through etsy for peace of mind. I will set up a &#39;design service fee&#39; listing which you can purchase, ill then set to work on creating your designs from the brief discussed. This fee does not include the price off the actual finished decal/s which will be priced accordingly. Custom orders can take 2 - 3 weeks to complete dependent on quantity and complexity. Please note artwork created remains the property of ArtJig.\r\n \r\nFor % &#39;quantity discounts&#39; on decals please message me stating quantity and required design.\r\n\r\nThanks for taking the time to read my policies.\r\n\r\nLuke.",
