"policy_shipping": "We are a small company and usually ship 2-3 times a week. Allow 1 to 4 days after purchase for your order to ship. Tracking information should be available from your order page.\r\n\r\n**INTERNATIONAL TRACKING DOES NOT EXTEND PAST THE BORDERS OF THE UNITED STATES.**\r\n\r\n**OCCASIONALLY (rarely) INTERNATIONAL ORDERS MAY BE CHARGED CUSTOMS FEES.  THIS IS ENTIRELY THE DECISION OF YOUR COUNTRY AND WE ARE NOT RESPONSIBLE FOR PAYING ANY CUSTOMS FEES ASSOCIATED WITH YOUR ORDER.**\r\n\r\n**We are not responsible for items lost by the Postal Service.  Unless you arrange for alternate shipping with us, you are paying the minimum shipment cost which does not provide insurance.**\r\n\r\nAll domestic orders are USPS First Class or Priority [for heavier items or larger orders]. International orders ship First Class International. For faster shipping, contact us ahead of time (BEFORE YOU ORDER) to arrange a custom listing. Note that upgraded shipping is significantly more expensive.  **Faster shipping options are not available in the month of December**\r\n\r\nEstimated shipping times:\r\nUS: 2-4 days\r\nCanada: 4-8 (except outer regions)\r\nEurope: 7-20\r\nAustralia/Rest of world: 12-30",
"policy_refunds": "If an item is damaged, defective, or the wrong item, we will replace it or give a refund. Return the item(s) to the return address listed on the label or our shop page. We will pay for return shipping & send a replacement or *paypal* refund once we receive the item.\r\n\r\nIf you are not satisfied with your item but it is in fine condition, you have 30 days to return it to us. We will refund the cost of the item via paypal, without our original cost or your cost of return shipping.\r\n\r\n**FOR ANY RETURN, INCLUDE A NOTE WITH YOUR NAME, REASON FOR RETURNING, AND WHAT ACTION YOU WANT US TO TAKE.**",
"policy_additional": "FAQ:\r\n\r\nQ: I sent you a message but got no response!!\r\nA: Sometimes things get buried! We are extremely busy. Feel free to spam us if necessary. Also, the original email address for this account is no longer in use so stick to etsy convos.\r\n\r\nQ: What shirts do you use/what is the chest size for a S/M/L/etc?\r\nA: http://www.bella.com/mens-crewneck-T.html\r\n\r\nQ: Why is my package stuck in Jamaica, NY?\r\nA: It&#39;s not! It should be well on it&#39;s way across the ocean. USPS First Class International tracking stops once it leaves the country.\r\n\r\nQ: Do you offer bulk pricing?\r\nA: Yes! Contact us for specific prices.\r\n\r\nQ: Do you offer wholesale pricing?\r\nA: Ditto!\r\n\r\nQ: Do you do custom orders/designs?\r\nA: No.\r\n\r\nQ: Why don&#39;t you make a shirt with _____ on it?\r\nA: We love hearing ideas! If we end up producing an item based on your suggestion, we&#39;ll send you one for free!",
