"title": "Wear your geek on your sleeve, and other places!",
"announcement": "Creating artifacts of Nerdville, Dorkopolis and Geektopia just for you! Feel free to follow us on Twitter @Nerdifacts. Earrings, Necklaces, Accessories, Notebooks, Sketchbooks and More for the Fanboy or Fangirl! Comics, Manga, and Pop Culture Literature is upcycled into amazing one-of-a-kind artifacts that you&#39;re going to totally geek out over. Send us a convo if your favourite pop culture craze is missing, we&#39;re always looking for ideas! Till then, dork it up, geek out, and nerd on!\r\n\r\nWe welcome custom orders, so don&#39;t be a stranger! Send a convo with your idea to get started.\r\n\r\n**Follow us on Facebook and Twitter simply by clicking to your right :)**",
