"vacation_message": "Thanks to all of my customers who helped make the 2014 holiday season my most successful one yet! I&#39;m now off to Barbados to enjoy a well earned vacation and the shop will reopen mid-late January. If you&#39;d still like to browse, check out the sold orders or visit the Nerdifacts Facebook page. Happy New Year everyone!",
