"policy_welcome": "If you order but are afraid that it might not arrive in to be given as a gift, I will happily provide an electronically sent printable that you can present as a gift until the package arrives. Just send me a convo or let me know in your notes to seller. ",
"policy_payment": "We currently only accept payment via PayPal, and the currency we sell our products in is measured in CAD (Canadian Dollars): Please note that you do not require a PayPal account to pay by credit card- all major cards are accepted. To pay, you must click on the PayPal button once your order has been processed through Etsy.\r\n\r\n*Payment is Due Upon Purchase* If you need extra time, simply contact us about it and we can make different arrangements, otherwise, if payment is not received within 3 days and no other arrangements have been made, your transaction will be canceled and the item will be re-listed.",
"policy_shipping": "We will ship in stock orders out same day wherever possible, but please allow two [2] business days before inquiring about your order. Please allow up to five [5] business days for custom orders, unless other arrangements have been made. \r\n\r\nOrders being shipped to the US and Internationally are shipped standard light packet air mail and should take a maximum of 14 days to arrive at their destination. If you require expedition, let us know in your notes to seller: 2-3 day timelines will be charged an additional fee of $30, and there is no guarantee that an item will arrive in 2 days instead of 3. Overnight shipping fees vary by destination so we will contact you with a quote first so that you don&#39;t get stuck paying a large fee that you hadn&#39;t anticipated. We will send you a paypal invoice for the updated shipping fee that needs to be paid before your order will be shipped. We appreciate your patience and understanding in this particular matter.\r\n\r\nWe have tried to indicate combined shipping costs, but as the sizes of items can vary, total shipping fees for a number of combined items may differ from what is listed. If this is the case for you, we will happily refund any shipping overcharges or notify you if any additional shipping fees are required.\r\n\r\n**Please note that we are not responsible for any customs/fees you are required to pay on international orders. These are not charges that we add. Please be aware of the policies for your particular country.",
"policy_refunds": "As a *general* rule, we don&#39;t process refunds or exchanges.\r\n\r\nIf you have received an item that is defective or damaged, please contact us so that we can come to a suitable arrangement to ensure that you are a happy customer. I like to deal with my customers personally about matters such as this so that the solution reached meets your unique needs. \r\n\r\nRefunds may be granted at the discretion of the seller, and exchanges must be approved in advance with return shipping fees covered by the buyer.",
