"description": "Each custom token starts out as a foil MTG card\nThe Images are then printed and placed onto the striped card to create an AMAZING foiled token\nEach token is handmade and may contain nicks or scratches as well as minor scuffs or marks on the back due to the stripping process\nThese cards are NOT tournament legal with the exception of the following\nThey may be used as proxies or tokens if a judge OK&#39;s them before the beginning of the tournament\nEvery judge may have a varying opinion and their final call is what should be followed\nEach card comes sleeved in a clear pro matte or like styled sleeve\nI can also go oversized commander cards, pokemon cards or yugioh cards. May be able to do proxys of other card games if you ask. \n\nThe material used to place the picture on the card is a very light weight malleable plastic film. This allows the card to be thinner and less noticeable inside of sleeves.\nI was running this in my EDH deck with double sleeves and no one would be able to tell the difference in thickness or playability from this and a normal MTG card.  Enjoy customizing your casual decks with these beautifully crafted proxies.\n\nITEM SPECIFICS:\nSome minor blemishes on the front due to air bubbles\nSome wear on the edges\nThe back of the card has some wear from the defoiling process\nThe image label has some wear along the edges from the tight fitting perfect fit that was used while the card was double sleeved.\nDon&#39;t hesitate in asking questions if you have any.\n\n\nI am willing to commission or do personalized requests.  Just contact me via the messaging system and we can talk out how we would like to go about making tokens or proxies of cards",
